import React from 'react';
import './App.css';

function App() {

  const [employeeList, setEmployeeList] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((employeeList) => {
        setEmployeeList(employeeList)
        console.log(employeeList)
      }
        );
  }, []);

  return (
    <div className="App">
      {employeeList.map( employee => {
        <p>{employee.first_name}</p>
      })}
    </div>
  );
}

export default App;
